@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'restaurant-app';
}
<div class="container">
  <h1>Witamy w aplikacji restaurant-app!</h1>
  <p>Jeśli nie masz jeszcze konta, <a routerLink="/register">zarejestruj się tutaj</a>.</p>
  <button routerLink="/login">Zaloguj się</button>
</div>
